import React from "react"
import { Route, Switch } from "react-router";
import Header from "../../Layout/Header";

class Blog extends React.Component {
    render() {
        return (
            <Switch>
                <Route path="/" component={Header} />
            </Switch>
        )
    }
}
export default Blog;
